import React from 'react';
import './Services.css';
import { FaHeartbeat, FaProcedures, FaStethoscope } from 'react-icons/fa';

const Services = () => {
  return (
    <section id="services" className="services">
      <h2>My Services</h2>
      <div className="services-container">
        <div className="service-item">
          <FaHeartbeat className="service-icon" />
          <h3>Vascular Surgery</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed nulla nibh, tincidunt sit amet sapien quis.</p>
          <a href="#learn-more">Learn more</a>
        </div>
        <div className="service-item">
          <FaProcedures className="service-icon" />
          <h3>Endovascular Treatment</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed nulla nibh, tincidunt sit amet sapien quis.</p>
          <a href="#learn-more">Learn more</a>
        </div>
        <div className="service-item">
          <FaStethoscope className="service-icon" />
          <h3>Peripheral Artery Disease</h3>
          <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Sed nulla nibh, tincidunt sit amet sapien quis.</p>
          <a href="#learn-more">Learn more</a>
        </div>
      </div>
    </section>
  );
};

export default Services;
